const App = () => {



  const classes = useStyles();
  return (
    <Section className={classes.app}>
      <Router>
        <NavBar />

        <Switch>
          <Route
            path="/"
            exact
            render={({ history }) => <UserTable history={history} />}
          />
          <Route path="/account/signin" component={AccountSigninScreen} exact />

          <Route path="/account/register" component={AccountAddScreen} exact />

          <Route path="/user/edit/:id" component={UserEditScreen} exact />

          <Route path="/user/add" component={UserAddScreen} exact />
        </Switch>
      </Router>
    </Section>
  );
};

export default App;
